Rules.InvariantScript:
Set(
    ExpandSubMenu,
    !ExpandSubMenu
);
Set(
    selHamMenuItem,
    ThisItem.ID
);Set(varMenuText,ThisItem.HMenuLbl);
If(
    ThisItem.HSubMenuVisible = false,
    Set(
        ExpandSubMenu,
        ThisItem.HSubMenuVisible
    );
    Set(
        selHamSubMenuItem,
        -1
    )
);
Navigate(ThisItem.Screen)

If(
    selHamMenuItem = ThisItem.ID,
    CountA(
        Filter(
            'Navigation Component'.SubMenuItems.HMenuRef,
            HMenuRef = selHamMenuItem
        )
    ) * 8,
    0
)

If(
    selHamMenuItem = ThisItem.ID And ExpandSubMenu,
    CountRows(
        Filter(
            'Navigation Component'.SubMenuItems.HMenuRef,
            HMenuRef = selHamMenuItem
        )
    ) * 38,
    0
)

Table(
    {
        ID:1,
        HMenuLbl: "Home",
        Screen: App.ActiveScreen,
        Icon: Icon.Home,
        HSubMenuVisible:false
    },
    {
        ID:2,
        HMenuLbl: "My Profile",
        //Screen: App.ActiveScreen,
        Icon: Icon.AddUser,
        HSubMenuVisible:true
        },
      {
        ID:3,
        HMenuLbl: "Timesheet",
        //Screen: App.ActiveScreen,
        Icon: Icon.Alarm,
        HSubMenuVisible:true
        },
        {
        ID:4,
        HMenuLbl: "Employee's Directory",
        //Screen: App.ActiveScreen,
        Icon: Icon.People,
        HSubMenuVisible:true
        },
        {
        ID:5,
        HMenuLbl: "Reports",
        //Screen: App.ActiveScreen,
        Icon: Icon.DocumentWithContent,
        HSubMenuVisible:false
        })

If(
    varOpenMenu,
        Max(App.Width,
            App.DesignWidth
        ) / 6
        , Max(
            App.Width,
            App.DesignWidth
        ) / 40
)
